function setTransactionLimits(uint256 maxTxPercent, uint256 maxSellPercent, uint256 maxWalletPercent) public {
    require(msg.sender == getOwner(), "Caller is not the owner");

    // Validate maxTxPercent
    require(maxTxPercent > 0, "maxTxPercent must be greater than 0");
    require(maxTxPercent <= 10000, "maxTxPercent exceeds maximum limit");

    // Validate maxSellPercent
    require(maxSellPercent > 0, "maxSellPercent must be greater than 0");
    require(maxSellPercent <= 10000, "maxSellPercent exceeds maximum limit");

    // Validate maxWalletPercent
    require(maxWalletPercent > 0, "maxWalletPercent must be greater than 0");
    require(maxWalletPercent <= 10000, "maxWalletPercent exceeds maximum limit");

    // Update transaction limits
    _maxTxAmount = (_totalSupply * maxTxPercent) / 10000;
    _maxSellAmount = (_totalSupply * maxSellPercent) / 10000;
    _maxWalletToken = (_totalSupply * maxWalletPercent) / 10000;
}

